INSERT INTO `eydeaninc_industry_` VALUES (1,'Agriculture','<p>Eydean provides analytical support in the field of agriculture. The machine learning services offer our clients an understanding of the strengths and weaknesses of their land. The focus is on preventing crops that are defective and maximizing the potential for healthy agricultural production. Factors such as population growth, global warming and other production issues are the threats for farmers and agricultural firms in recent times.&nbsp;</p>\r\n\r\n<p>This results in the lookup for some other innovative way of improving agricultural products. AI has thus made its way as a new approach to innovative farming.</p>','<p>Agriculture is one of the world\'s oldest and most important occupations. A lot of technology has evolved on how farming can be done. Because of population growth and land scarcity, more creative methods of farming are needed. Eydean offers revolutionary and effective technology for agriculture around the globe i.e. AI technology in farming. Eydean allows farmers to identify diseases in crops, pests and poor crop nutrition on farms with the help of AI technology.&nbsp;</p>\r\n\r\n<p>Our AI technology can detect the problems in the farm and decide the herbicide to be used. This prevents the herbicide from making its way into the food. We can also assist farmers by providing a season forecasting model that can be used to predict the weather months before and thus improve their decision-making.</p>','71bd41','analysis of different factors can be done in real time such as weather conditions, temperature, water usage or soil conditions for better decision making','agriculture');
/*!40000 ALTER TABLE `eydeaninc_industry_` ENABLE KEYS */;
UNLOCK TABLES;

