INSERT INTO `eydeaninc_service_` VALUES (1,'Business Process Management','<p>Eydean is the only enterprise business intelligence platform that connects together the entire organization through a shared common analytical fabric. Eydean’s prominent BI delivers the speed, self-service, and agility front-line business workers demand, and the scale, security, and control to meet rigorous corporate data standards. Eydean delivers all of this and much more with low TCO via public or private cloud configurations.</p>','<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Molestias praesentium accusamus aut distinctio quod! Natus, vero, nam magnam aut repudiandae eum velit iste adipisci totam vitae nisi ab laudantium. Veniam, eos, cupiditate perspiciatis totam accusantium eligendi amet laboriosam doloribus quod ipsum facilis iure laborum necessitatibus expedita doloremque eius magni iusto impedit aspernatur ten</p>','ffb11f','business-process-management','[{\"number_info\":\"Customers Served\",\"number_count\":100},{\"number_info\":\"Revenue Met\",\"number_count\":535},{\"number_info\":\"Enterprises Consulted\",\"number_count\":659}]','bpm');
