INSERT INTO `system_plugin_history` VALUES (1,'October.Demo','comment','1.0.1','First version of Demo','2019-11-24 00:22:14'),(2,'October.Drivers','comment','1.0.1','First version of Drivers','2019-11-24 00:22:19'),(3,'October.Drivers','comment','1.0.2','Update Guzzle library to version 5.0','2019-11-24 00:22:19'),(4,'October.Drivers','comment','1.1.0','Update AWS library to version 3.0','2019-11-24 00:22:19'),(5,'October.Drivers','comment','1.1.1','Update Guzzle library to version 6.0','2019-11-24 00:22:19'),(6,'October.Drivers','comment','1.1.2','Update Guzzle library to version 6.3','2019-11-24 00:22:19'),(7,'RainLab.Builder','comment','1.0.1','Initialize plugin.','2019-11-24 00:22:22'),(8,'RainLab.Builder','comment','1.0.2','Fixes the problem with selecting a plugin. Minor localization corrections. Configuration files in the list and form behaviors are now autocomplete.','2019-11-24 00:22:22'),(9,'RainLab.Builder','comment','1.0.3','Improved handling of the enum data type.','2019-11-24 00:22:23'),(10,'RainLab.Builder','comment','1.0.4','Added user permissions to work with the Builder.','2019-11-24 00:22:23'),(11,'RainLab.Builder','comment','1.0.5','Fixed permissions registration.','2019-11-24 00:22:23'),(12,'RainLab.Builder','comment','1.0.6','Fixed front-end record ordering in the Record List component.','2019-11-24 00:22:23'),(13,'RainLab.Builder','comment','1.0.7','Builder settings are now protected with user permissions. The database table column list is scrollable now. Minor code cleanup.','2019-11-24 00:22:23'),(14,'RainLab.Builder','comment','1.0.8','Added the Reorder Controller behavior.','2019-11-24 00:22:23'),(15,'RainLab.Builder','comment','1.0.9','Minor API and UI updates.','2019-11-24 00:22:23'),(16,'RainLab.Builder','comment','1.0.10','Minor styling update.','2019-11-24 00:22:23'),(17,'RainLab.Builder','comment','1.0.11','Fixed a bug where clicking placeholder in a repeater would open Inspector. Fixed a problem with saving forms with repeaters in tabs. Minor style fix.','2019-11-24 00:22:23'),(18,'RainLab.Builder','comment','1.0.12','Added support for the Trigger property to the Media Finder widget configuration. Names of form fields and list columns definition files can now contain underscores.','2019-11-24 00:22:23'),(19,'RainLab.Builder','comment','1.0.13','Minor styling fix on the database editor.','2019-11-24 00:22:23'),(20,'RainLab.Builder','comment','1.0.14','Added support for published_at timestamp field','2019-11-24 00:22:23'),(21,'RainLab.Builder','comment','1.0.15','Fixed a bug where saving a localization string in Inspector could cause a JavaScript error. Added support for Timestamps and Soft Deleting for new models.','2019-11-24 00:22:23'),(22,'RainLab.Builder','comment','1.0.16','Fixed a bug when saving a form with the Repeater widget in a tab could create invalid fields in the form\'s outside area. Added a check that prevents creating localization strings inside other existing strings.','2019-11-24 00:22:23'),(23,'RainLab.Builder','comment','1.0.17','Added support Trigger attribute support for RecordFinder and Repeater form widgets.','2019-11-24 00:22:23'),(24,'RainLab.Builder','comment','1.0.18','Fixes a bug where \'::class\' notations in a model class definition could prevent the model from appearing in the Builder model list. Added emptyOption property support to the dropdown form control.','2019-11-24 00:22:23'),(25,'RainLab.Builder','comment','1.0.19','Added a feature allowing to add all database columns to a list definition. Added max length validation for database table and column names.','2019-11-24 00:22:23'),(26,'RainLab.Builder','comment','1.0.20','Fixes a bug where form the builder could trigger the \"current.hasAttribute is not a function\" error.','2019-11-24 00:22:23'),(27,'RainLab.Builder','comment','1.0.21','Back-end navigation sort order updated.','2019-11-24 00:22:23'),(28,'RainLab.Builder','comment','1.0.22','Added scopeValue property to the RecordList component.','2019-11-24 00:22:23'),(29,'RainLab.Builder','comment','1.0.23','Added support for balloon-selector field type, added Brazilian Portuguese translation, fixed some bugs','2019-11-24 00:22:23'),(30,'RainLab.Builder','comment','1.0.24','Added support for tag list field type, added read only toggle for fields. Prevent plugins from using reserved PHP keywords for class names and namespaces','2019-11-24 00:22:23'),(31,'RainLab.Builder','comment','1.0.25','Allow editing of migration code in the \"Migration\" popup when saving changes in the database editor.','2019-11-24 00:22:23'),(32,'RainLab.Builder','comment','1.0.26','Allow special default values for columns and added new \"Add ID column\" button to database editor.','2019-11-24 00:22:23'),(33,'EydeanInc.Industry','comment','1.0.1','Initialize plugin.','2019-11-24 01:05:38'),(34,'EydeanInc.Industry','script','1.0.2','builder_table_create_eydeaninc_industry_.php','2019-11-24 01:10:36'),(35,'EydeanInc.Industry','comment','1.0.2','Created table eydeaninc_industry_','2019-11-24 01:10:36'),(36,'EydeanInc.Industry','script','1.0.3','builder_table_update_eydeaninc_industry_.php','2019-11-24 01:25:30'),(37,'EydeanInc.Industry','comment','1.0.3','Updated table eydeaninc_industry_','2019-11-24 01:25:30'),(38,'EydeanInc.Industry','script','1.0.4','builder_table_update_eydeaninc_industry__2.php','2019-11-24 01:56:20'),(39,'EydeanInc.Industry','comment','1.0.4','Updated table eydeaninc_industry_','2019-11-24 01:56:20'),(40,'EydeanInc.Service','comment','1.0.1','Initialize plugin.','2019-11-25 20:02:33'),(41,'EydeanInc.Service','script','1.0.2','builder_table_create_eydeaninc_service_.php','2019-11-25 20:05:06'),(42,'EydeanInc.Service','comment','1.0.2','Created table eydeaninc_service_','2019-11-25 20:05:06'),(43,'EydeanInc.Service','script','1.0.3','builder_table_update_eydeaninc_service_.php','2019-11-25 20:20:52'),(44,'EydeanInc.Service','comment','1.0.3','Updated table eydeaninc_service_','2019-11-25 20:20:52'),(45,'EydeanInc.Service','script','1.0.4','builder_table_update_eydeaninc_service__2.php','2019-11-25 20:37:31'),(46,'EydeanInc.Service','comment','1.0.4','Updated table eydeaninc_service_','2019-11-25 20:37:31');
